import React from "react";
import { Nav, Navbar, NavItem } from "react-bootstrap";

import "../Header/Header.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link, NavLink } from "react-router-dom";

class Header extends React.Component {
  state = {
    email: "",
    password: "",
    navigate: false,
  };

  handleLogOut = async (event) => {
    try {
      await localStorage.clear("jwt");
      // TODO: remove user from state.
      this.props.setUser("");
      console.log("here");
    } catch (err) {
      console.log(err);
    }
  };

  render() {
    // console.log("in header render", this.props.user);
    return (
      <Navbar collapseOnSelect expand="sm" className="color-nav" fixed="top">
        <Navbar.Brand>
          <Link to="/">
            <span className="spots">Spots</span>
          </Link>
        </Navbar.Brand>

        <span className="ml-auto">
          {this.props.user ? (
            <>
              <NavLink to="/createSpot" activeClassName="active">
                <span className="createSpot">Create</span>
              </NavLink>
              <NavLink
                to="/"
                activeClassName="active"
                onClick={this.handleLogOut}
              >
                <span className="signUp">Logout</span>
              </NavLink>
              <NavLink to="/signUp" activeClassName="active">
                <span className="signUp">About</span>
              </NavLink>
            </>
          ) : (
            <>
              <NavLink to="/signUp" activeClassName="active">
                <span className="signUp">Signup</span>
              </NavLink>
              <NavLink to="/logIn" activeClassName="active">
                <span className="logIn">Login</span>
              </NavLink>
            </>
          )}
        </span>
      </Navbar>
    );
  }
}
export default Header;
